  `STATS_DTTM` int(11) NOT NULL COMMENT '통계일자|통계의 일자를 기록||',
  `PLTFOM_TP_CODE` varchar(2) NOT NULL COMMENT '플랫폼구분|플랫폼 구분|MOBON_COM_CODE.PLTFOM_TP|',
  `ADVRTS_PRDT_CODE` varchar(2) NOT NULL COMMENT '광고구분|광고 구분|MOBON_COM_CODE.ADVRTS_TP|',
  `ADVRTS_TP_CODE` varchar(2) NOT NULL COMMENT '광고유형|광고 유형|MOBON_COM_CODE.ADVRTS_TY|',
  `SITE_CODE` varchar(40) NOT NULL COMMENT '사이트코드|사이트 코드|adsite.site_code|',
  `MEDIA_SCRIPT_NO` int(11) NOT NULL DEFAULT '0' COMMENT '미디어스크립트번호|미디어스크립트 번호|media_script.no|',
  `ORDER_NO` int(11) NOT NULL COMMENT '키워드지정번호|키워드지정 고유번호||',
  `CLICK_TP` varchar(1) NOT NULL DEFAULT 'V' COMMENT '클릭부분|클릭 구분, 기본값 노출|V:노출, C:클릭|',
  `SESION_SELNG_YN` varchar(1) NOT NULL DEFAULT 'N' COMMENT '세션매출여부|세션 매출여부, 기본값 N|Y:세션매출, N:세션아님|',
  `DIRECT_YN` varchar(1) NOT NULL DEFAULT 'N' COMMENT '직접여부|직간접 여부, 기본값 N|Y:직접, N:간접|',
