  `ORDER_QY` int(11) NOT NULL DEFAULT '0' COMMENT '주문수량|주문수량||',
  `REG_USER_ID` varchar(30) NOT NULL DEFAULT 'ADMIN' COMMENT '등록사용자ID|등록사용자ID를 기록|admember.userid|',
