  `ALT_DTTM` datetime DEFAULT NULL COMMENT '수정일자|수정시간을 기록||',
  PRIMARY KEY (`STATS_DTTM`,`PLTFOM_TP_CODE`,`ADVRTS_PRDT_CODE`,`ADVRTS_TP_CODE`,`SITE_CODE`,`MEDIA_SCRIPT_NO`,`ORDER_NO`)
