	(STATS_DTTM, PLTFOM_TP_CODE, ADVRTS_PRDT_CODE, ADVRTS_TP_CODE, ADVER_ID, MEDIA_SCRIPT_NO, TOT_EPRS_CNT, ADVRTS_AMT, MEDIA_PYMNT_AMT) VALUES($sdate, $platform, $product, $ad_gubun, $advertiser_id, $media_script_no, $tview_cnt, $POINT, $mpoint)
