	IF $kno = 0 THEN
		INSERT INTO MOB_ADVER_STATS
		(STATS_DTTM, PLTFOM_TP_CODE, ADVRTS_PRDT_CODE, ADVRTS_TP_CODE, SITE_CODE, MEDIA_SCRIPT_NO, TOT_EPRS_CNT, ADVRTS_AMT, MEDIA_PYMNT_AMT) VALUES($sdate, $platform, $product, $ad_gubun, $site_code, $media_script_no, $tview_cnt, $POINT, $mpoint)
