		ON DUPLICATE KEY UPDATE TOT_EPRS_CNT=TOT_EPRS_CNT+$tview_cnt, ADVRTS_AMT=ADVRTS_AMT+$POINT, MEDIA_PYMNT_AMT=MEDIA_PYMNT_AMT+$mpoint;
	END IF ;
